I went to high school with the hot Holly Michaels and I always had a huge crush on her, but I figured she was out of my league so I never bothered asking her out. Once I found out what she was doing for a living I figured I could finally live out my high school fantasy. I call her over to my room and have her role play that we're high school sweethearts. After all these years, I guess dreams really do cum true
